import "./App.css";
import Home from "./Home";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Header from "./Header";

function App() {
  return (
    <div>
      <Header/>
          <div className="App">
                  <Routes>
                      <Route exact path="/" element={ <Home />}/>
                      <Route exact path="/Admin" element={ <Home />}/>
                  </Routes>
            </div>
    </div>
  );
}

export default App;
